import React, { useState } from 'react';
import { emergencyRequestAPI } from '../../utils/apiService';

const EmergencyRequestTest = () => {
  const [testRequest, setTestRequest] = useState({
    brigadeId: 'test-brigade-001',
    brigadeName: 'Test Fire Brigade',
    brigadeLocation: 'Test Location',
    requestType: 'Emergency Water Supply',
    priority: 'High',
    waterLevel: '25%',
    description: 'Test emergency water request for demonstration purposes',
    coordinates: { lat: 6.9271, lng: 79.8612 }
  });
  const [isSubmitting, setIsSubmitting] = useState(false);
  const [result, setResult] = useState(null);

  const handleSubmit = async (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    setResult(null);

    try {
      const response = await emergencyRequestAPI.createRequest(testRequest);
      setResult({
        success: true,
        message: 'Emergency request created successfully!',
        data: response.data
      });
    } catch (error) {
      setResult({
        success: false,
        message: 'Failed to create emergency request',
        error: error.message
      });
    } finally {
      setIsSubmitting(false);
    }
  };

  const handleGetRequests = async () => {
    try {
      const response = await emergencyRequestAPI.getAllRequests();
      setResult({
        success: true,
        message: 'Emergency requests retrieved successfully!',
        data: response.data
      });
    } catch (error) {
      setResult({
        success: false,
        message: 'Failed to get emergency requests',
        error: error.message
      });
    }
  };

  return (
    <div className="max-w-4xl mx-auto p-6">
      <h1 className="text-3xl font-bold text-gray-900 mb-6">Emergency Request Test</h1>
      
      <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
        {/* Test Form */}
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold mb-4">Create Test Emergency Request</h2>
          
          <form onSubmit={handleSubmit} className="space-y-4">
            <div>
              <label className="block text-sm font-medium text-gray-700">Brigade Name</label>
              <input
                type="text"
                value={testRequest.brigadeName}
                onChange={(e) => setTestRequest({...testRequest, brigadeName: e.target.value})}
                className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
              />
            </div>
            
            <div>
              <label className="block text-sm font-medium text-gray-700">Location</label>
              <input
                type="text"
                value={testRequest.brigadeLocation}
                onChange={(e) => setTestRequest({...testRequest, brigadeLocation: e.target.value})}
                className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
              />
            </div>
            
            <div>
              <label className="block text-sm font-medium text-gray-700">Priority</label>
              <select
                value={testRequest.priority}
                onChange={(e) => setTestRequest({...testRequest, priority: e.target.value})}
                className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
              >
                <option value="Low">Low</option>
                <option value="Medium">Medium</option>
                <option value="High">High</option>
                <option value="Critical">Critical</option>
              </select>
            </div>
            
            <div>
              <label className="block text-sm font-medium text-gray-700">Water Level</label>
              <input
                type="text"
                value={testRequest.waterLevel}
                onChange={(e) => setTestRequest({...testRequest, waterLevel: e.target.value})}
                className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
              />
            </div>
            
            <div>
              <label className="block text-sm font-medium text-gray-700">Description</label>
              <textarea
                value={testRequest.description}
                onChange={(e) => setTestRequest({...testRequest, description: e.target.value})}
                rows={3}
                className="mt-1 block w-full border border-gray-300 rounded-md px-3 py-2"
              />
            </div>
            
            <button
              type="submit"
              disabled={isSubmitting}
              className={`w-full py-2 px-4 rounded-md ${
                isSubmitting 
                  ? 'bg-gray-400 cursor-not-allowed' 
                  : 'bg-red-600 hover:bg-red-700'
              } text-white`}
            >
              {isSubmitting ? 'Creating...' : 'Create Emergency Request'}
            </button>
          </form>
        </div>

        {/* Test Actions */}
        <div className="bg-white rounded-lg shadow p-6">
          <h2 className="text-xl font-semibold mb-4">Test Actions</h2>
          
          <div className="space-y-4">
            <button
              onClick={handleGetRequests}
              className="w-full bg-blue-600 text-white py-2 px-4 rounded-md hover:bg-blue-700"
            >
              Get All Emergency Requests
            </button>
            
            <div className="bg-gray-50 rounded-lg p-4">
              <h3 className="font-medium text-gray-900 mb-2">Instructions:</h3>
              <ol className="text-sm text-gray-600 space-y-1">
                <li>1. Fill out the form and create a test emergency request</li>
                <li>2. Go to the admin dashboard to see the request</li>
                <li>3. Use "Get All Emergency Requests" to verify the API</li>
                <li>4. Check the admin dashboard for real-time updates</li>
              </ol>
            </div>
          </div>
        </div>
      </div>

      {/* Results */}
      {result && (
        <div className={`mt-6 p-4 rounded-lg ${
          result.success ? 'bg-green-50 border border-green-200' : 'bg-red-50 border border-red-200'
        }`}>
          <h3 className={`font-medium ${result.success ? 'text-green-800' : 'text-red-800'}`}>
            {result.message}
          </h3>
          {result.error && (
            <p className="text-red-600 mt-1">{result.error}</p>
          )}
          {result.data && (
            <pre className="mt-2 text-sm bg-gray-100 p-2 rounded overflow-auto">
              {JSON.stringify(result.data, null, 2)}
            </pre>
          )}
        </div>
      )}
    </div>
  );
};

export default EmergencyRequestTest;
